&lt;p&gt;&lt;strong&gt;Cerveza rubia Patagonia 24.7 IPA con sauco 730 cc.&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Cerveza rubia amarga, de un color dorado ayudado por el sauco es, como toda session beer, una cerveza de menor contenido alcoh&amp;oacute;lico.&lt;/p&gt;
&lt;p&gt;Conservando un intenso aroma a l&amp;uacute;pulo gracias a su t&amp;eacute;cnica de Dry Hopping, combina una entrada cargada de amargor y un dejo dulce en el final a partir del sauco a&amp;ntilde;adido en fr&amp;iacute;o.&lt;/p&gt;

&quot;Jugo en Polvo Verao para Preparar. Rinde 1 litro.
Probá el NUEVO Verao sabor a Frutas. El más rico y rendidor jugo para compartir en la mesa, para el tereré o para jugar en familia y preparar las recetas con sabor a Fruta más refrescantes. Estas vacaciones elegí Verao. No te pierdas las ofertas y stockeate con los jugos que elegís para tu familia. 
La caja contiene 20 sobres.&quot;

