&lt;p&gt;&lt;strong&gt;Quilmes Red Lager&lt;/strong&gt; es una cerveza roja que se destaca por su equilibrio, cremosidad y su delicado sabor amargo.&lt;/p&gt;
&lt;p&gt;Resulta f&amp;aacute;cil de tomar e ideal para resaltar momentos especiales.&lt;/p&gt;
&lt;p&gt;Su color rojo cobrizo es producto de la perfecta combinaci&amp;oacute;n de maltas finamente seleccionadas y el tostado natural de los taninos de la cebada durante el proceso de malteo.&lt;/p&gt;

